class ExampleUnitTest {
    @Test
    fun addition_isCorrect() {
        assertEquals(4, 2 + 2)
    }

    @Test
    fun countPosition() {

        val oriBase = -9.0

        val valueParse = ArrayList<String>()
        for (i in 0..30) {
            val count = (oriBase + i * 0.5)
            valueParse.add(count.toString())
        }

        assert(valueParse[30] == "6.0")

    }

    @Test
    fun testLastNum() {

        val i: Double = -3.0
        val lastNum = abs(i % 1)

        assert((lastNum) != 0.0)
    }

    @Test
    fun testNum() {

        val i: Double = -5.5
        val lastNum = i.toInt()

        assert(lastNum == -5)
    }

    @Test
    fun testPkLift() {

        val min = -9.0
        val i: Double = -3.0
        val pkSize = 6.0 - min

        val leftPicker = pkSize - (i - min)

        assert(true)
    }

    @Test
    fun verCheck() {
        val beCheck = 20240617
        val checkNum = 20240617
        val check = beCheck < checkNum

        assert(check == true)
    }

